      <div className='header-divider'>{props.title}</div>
      <h1 className='font-effect-fire-animation'>Burger Hub</h1>
      <span>
        Best burger in 
        <span className='sub-header'>#Brooklyn</span>
      </span>
    </div>
  </div>
</header>
);

